
class Solution(object):
    def maximumRemovals(self, s, p, removable):
        """
        :type s: str
        :type p: str
        :type removable: List[int]
        :rtype: int
        """
        lo= 0
        hi = len(removable)+1
        dic={}
        for i in range(len(s)):
            dic[i] = len(s)+2
        for i,a in enumerate(removable):
            dic[a] = i
        n = len(s)
        m = len(p)
        #print(dic)
        def check(stra,strb,mid):
            m = len(stra)
            n = len(strb)
            idx =0
            for i in range(n):
                if dic[i] <mid:
                    continue
                if idx <m and strb[i] == stra[idx]:
                    idx +=1
            return idx == m
        while lo < hi:
            mid =(hi+lo )>>1
            #print(mid)
            if check(p,s,mid):
                lo = mid +1
            else:
                hi=mid
        return lo -1

        
